import React from 'react'

export const Navbar = () => {
  return (
    <nav>
      <ul>
        <li><a href="#">Anasayfa</a></li>
        <li><a href="#">Diziler</a></li>
        <li><a href="#">Filmler</a></li>
        <li><a href="#">Listem</a></li>
        <li><a href="#">Listem</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
